function image2Base64(img) {
  var canvas = document.createElement("canvas");
  canvas.width = img.width;
  canvas.height = img.height;
  var ctx = canvas.getContext("2d");
  ctx.drawImage(img, 0, 0, img.width, img.height);
  var dataURL = canvas.toDataURL("image/png");
  return dataURL;
}

function dataURLtoBlob(base64) {
  var arr = base64.split(",");
  //var mime = arr[0].match(/:(.*?);/)[1];
  // 去掉url的头，并转化为byte
  var bytes = window.atob(base64);
  // 处理异常,将ascii码小于0的转换为大于0
  var ab = new ArrayBuffer(bytes.length);
  // 生成视图（直接针对内存）：8位无符号整数，长度1个字节
  var ia = new Uint8Array(ab);

  for (var i = 0; i < bytes.length; i++) {
    ia[i] = bytes.charCodeAt(i);
  }

  return new Blob([ab], {
    type: "pdf",
  });
}

function fake_click(obj) {
  var ev = document.createEvent("MouseEvents");
  ev.initMouseEvent(
    "click",
    true,
    false,
    window,
    0,
    0,
    0,
    0,
    0,
    false,
    false,
    false,
    false,
    0,
    null
  );
  obj.dispatchEvent(ev);
}

function download(name, data) {
  var urlObject = window.URL || window.webkitURL || window;

  var downloadData = new Blob([data]);

  var save_link = document.createElementNS("http://www.w3.org/1999/xhtml", "a");
  save_link.href = urlObject.createObjectURL(downloadData);
  save_link.download = name;
  fake_click(save_link);
}

function blobToFile(theBlob, fileName) {
  theBlob.lastModifiedDate = new Date();
  theBlob.name = fileName;
  return theBlob;
}

function blend_img(canvas, sign, finger) {
  //获取canvas上下文
  var ctx = canvas.getContext("2d");
  ctx.fillStyle = "#FFFFFFFF";
  var w = ctx.width;
  var h = ctx.height;
  ctx.clear(0, 0, w, h);

  //开始画签名图像
  ctx.drawImage(sign, 0, 0);
  //设置混合透明度
  ctx.globalAlpha = 0.6;
  //开始画指纹
  //将指纹图像成比例缩放
  var scale = finger.height / h;

  //缩放后的新宽高
  var fw = finger.width / scale;
  var fh = finger.height / scale;
  //计算指纹图像居中的偏移x
  var offset_x = (w - fw) / 2;

  ctx.drawImage(finger, offset_x, 0, fw, fh);

  //返回合成的图像base64
  return canvas.toDataURL("image/png");
}

